import React from 'react'
import {List} from 'antd'

function ChatLobby() {
    const data = [
        {
            title: 'Lobby 1',
        },
        {
            title: 'Lobby 2',
        },
        {
            title: 'Lobby 3'
        }

    ]
    return (
        <div>
            <List
                itemLayout = 'horizontal'
                dataSource = {data}
            >

            </List>
        </div>
    )
}

export default ChatLobby
